The present invention relates to a detection system and method for detecting the correct fastening of a seat belt. The system comprises: 
weighing means for obtaining the weight ( P ) of the seated person; 
sensor means for detecting the fastening of the belt; 
sensor means for measuring the length of an unwound band for obtaining the length (Δ L ) of an unwound seat belt band; 
control means for: 
• detecting (300) the fastening of the belt; 
• obtaining (302) the length (Δ L ) of an unwound band; 
• obtaining (302) the weight ( P ) of the person on the seat; 
• determining (308,314) whether the seat belt is correctly fastened depending on the detection (300) of the fastening of the belt and on the values of length (Δ L ) of the unwound band and of weight ( P ). 

 It is used to permanently control the correct fastening of the seat belt of the occupants of the vehicle.

Dispositif d'émission - réception de signaux dans deux bandes de fréquences symétriques par rapport à une première fréquence F CA  et telles que chacune des bandes comporte des canaux symétriques par rapport à des deuxièmes fréquences F CLA , F CUA , comportant : 
- des premiers moyens (102, 116) générant un signal de fréquence F A , un signal de fréquence F B  = F A /N1, un signal de fréquence F 1  = |F CA  - F CLA | et un signal périodique de fréquence F 2  égale à la différence entre une fréquence centrale d'un des canaux et la deuxième fréquence associée, et dans lequel F A  = N1.(F CLA  + F1)/(N1 + 1) ; 
- des deuxième moyens (130 - 140) aptes à réaliser des opérations non linéaires entre les signaux de fréquences F A  et F 1  et ceux de fréquences F B  et F 2 , générant des signaux multi-tonalités comportant les fréquences F A -F 1 , F A +F 1 , F B -F 2  et F B +F 2 .

Dispositifélectronique (100) comportant une structure d'interconnexions (102) comportant un empilement alterné de réseaux de lignes conductrices (108, 112, 116) et de couches diélectriques (106, 110, 114, 118) dans lequel : 
- toutes les lignes d'un même réseau s'étendent dans un même plan et forment un equipotentiel ; 
- un premier motif d'un premier réseau est tel que les lignes du premier réseau se croisent en plusieurs d'intersections (120) ; 
- un troisième motif d'un troisième réseau est similaire, superposé et aligné au premier motif; 
- un deuxième motif d'un deuxième réseau disposé entre les premier et troisième réseaux est tel que les lignes du deuxième réseau se croisent en plusieurs d'intersections (122) décalées par rapport à celles des premier et troisième motifs ; 
- un premier via conducteur (126) s'étend depuis une ligne du premier et/ou troisième réseau et n'est pas en contact avec le deuxième réseau.

Structure (1) comportant : 
- une première plaquette (W1), comprenant des premiers composants actifs (C1) configurés pour introduire un déphasage ; 
- une première couche métallique, formée sur une première surface (W10) de la première plaquette (W1) ; 
- une première structure d'interconnexions (3), formée sur une seconde surface (W11) de la première plaquette (W1), comprenant des premières lignes de polarisation (30) ; 
- un ensemble de premières antennes planaires (A1), formé sur la première structure d'interconnexions (3) ; 
- une deuxième plaquette (W2) ; 
- une deuxième couche métallique, formée sur une première surface (W20) de la deuxième plaquette (W2) ; 
- un ensemble de deuxièmes antennes planaires (A2), formé sur une seconde surface (W21) de la deuxième plaquette (W2) ; 
les première et deuxième plaquettes (W1, W2) étant assemblées par l'intermédiaire des première et deuxième couches métalliques de sorte que les premières et deuxièmes antennes planaires (A1, A2) sont alignées, les première et deuxième couches métalliques formant un plan de masse (PM).
